`,A1=()=>{const e=Hl(),t=()=>{e("/question")};return W.jsxs(M1,{children:[W.jsx(O1,{children:"나와 어울리는 겨울간식은?"}),W.jsxs(F1,{children:[W.jsx($1,{children:W.jsx("img",{className:"rounded-circle",src:"/snack/mainphoto.jpg"})}),W.jsx(U1,{children:"🥄 MBTI를 기반으로 하는 나와 어울리는 겨울 간식 찾기 🥄"}),W.jsx(Ar,{size:"lg",onClick:t,children:"테스트 시작하기"})]})]})},Mn=[{id:1,title:"겨울 축제에 가게 된다면, 당신의 선택은?",answera:"친구들과 함께 신나게 즐긴다.",answerb:"조용히 혼자서 분위기를 즐긴다.",type:"EI"},{id:2,title:"겨울 방학 동안의 계획은?",answera:"여러 사람들과 다양한 활동을 계획한다.",answerb:"혼자만의 시간을 가지며 휴식을 취한다.",type:"EI"},{id:3,title:"겨울 간식을 만들 때, 당신의 스타일은?",answera:"친구들과 함께 만들며 즐거운 시간을 보낸다.",answerb:"혼자서 조용히 만들며 집중한다.",type:"EI"},{id:4,title:"겨울 간식을 고를 때, 당신의 기준은?",answera:"익숙하고 안전한 맛을 선택한다.",answerb:"새롭고 독특한 맛을 시도해본다.",type:"SN"},{id:5,title:"겨울철 여행을 계획할 때, 당신의 접근 방식은?",answera:"구체적인 계획을 세우고 준비한다.",answerb:"즉흥적으로 떠나며 새로운 경험을 찾는다.",type:"SN"},{id:6,title:"겨울 패션을 선택할 때, 당신의 스타일은?",answera:"실용적이고 편안한 스타일을 선호한다.",answerb:"트렌디하고 독특한 스타일을 시도한다.",type:"SN"},{id:7,title:"겨울철 친구의 고민을 들었을 때, 당신의 반응은?",answera:"논리적으로 문제를 해결하려고 한다.",answerb:"감정적으로 공감하며 위로한다.",type:"TF"},{id:8,title:"겨울철 쇼핑을 할 때, 당신의 선택 기준은?",answera:"가격과 성능을 비교하여 선택한다.",answerb:"디자인과 감성을 중시하여 선택한다.",type:"TF"},{id:9,title:"겨울철 영화 선택 시, 당신의 기준은?",answera:"평점과 리뷰를 꼼꼼히 확인한다.",answerb:"감정적으로 끌리는 영화를 선택한다.",type:"TF"},{id:10,title:"겨울 휴가 계획을 세울 때, 당신의 스타일은?",answera:"미리 계획을 세워 철저히 준비한다.",answerb:"즉흥적으로 계획을 세우고 유연하게 대처한다.",type:"JP"},{id:11,title:"겨울철 집안 정리를 할 때, 당신의 방식은?",answera:"체계적으로 정리하고 계획적으로 진행한다.",answerb:"필요할 때마다 즉흥적으로 정리한다.",type:"JP"},{id:12,title:"겨울철 운동 계획을 세울 때, 당신의 접근 방식은?",answera:"정해진 시간에 맞춰 규칙적으로 운동한다.",answerb:"기분에 따라 유동적으로 운동한다.",type:"JP"}],B1=[{id:0,mbti:"ISTJ",snack:"군고구마",desc:"ISTJ는 실용성과 전통을 중요시하는 성격으로, 겨울에 따뜻한 군고구마를 즐기는 편입니다. 고소하면서도 달콤한 맛을 지닌 군고구마는 차분히 시간을 보내며 따뜻함을 느끼기에 안성맞춤인 간식이죠. 이들은 군고구마의 소박하고 자연스러운 맛에 끌리며, 추운 겨울을 잠시 잊게 해주는 이 간식은 ISTJ의 성향과 잘 어울립니다. 군고구마를 먹으면서 ISTJ는 지난날의 추억을 되새기고, 자신의 삶에 대해 깊이 생각해볼 수 있습니다. 그들은 군고구마의 따스한 기운 속에서 혼자만의 시간을 가지며 내적 평화를 찾아갑니다.",img:"/snack/snack0.jpg"},{id:1,mbti:"ISFJ",snack:"붕어빵",desc:"ISFJ는 따뜻하고 배려심이 많은 성격으로, 겨울철에 붕어빵을 즐깁니다. 붕어빵은 달콤한 팥소가 가득 차 있어, 추운 날씨에 따뜻한 위로를 제공합니다. ISFJ는 붕어빵을 통해 가족이나 친구들과 함께 따뜻한 추억을 만들고, 그들의 배려심을 표현할 수 있습니다. 붕어빵을 나누며 ISFJ는 주변 사람들과의 유대감을 강화하고, 그들의 삶에 긍정적인 영향을 미칩니다. 이들은 붕어빵의 달콤함 속에서 사랑과 우정을 느끼며, 그들의 따뜻한 마음을 나눕니다.",img:"/snack/snack1.jpg"},{id:2,mbti:"INFJ",snack:"호떡",desc:"INFJ는 깊이 있는 성격으로, 겨울철에 호떡을 즐깁니다. 호떡은 달콤한 시럽이 가득한 간식으로, INFJ의 내면적인 깊이와 잘 어울립니다. 이들은 호떡을 통해 따뜻한 감정을 느끼고, 자신만의 시간을 가지며 사색에 잠길 수 있습니다. 호떡을 먹으며 INFJ는 그들의 이상과 꿈을 되새기고, 세상에 대한 깊은 이해를 추구합니다. 이들은 호떡의 달콤함 속에서 영감을 얻고, 그들의 창의적인 아이디어를 발전시킵니다.",img:"/snack/snack2.jpg"},{id:3,mbti:"INTJ",snack:"찐빵",desc:"INTJ는 분석적이고 계획적인 성격으로, 겨울철에 찐빵을 즐깁니다. 찐빵은 부드럽고 따뜻한 간식으로, INTJ의 체계적인 사고와 잘 맞습니다. 이들은 찐빵을 통해 겨울철의 차가운 날씨를 이겨내고, 따뜻한 휴식을 취할 수 있습니다. 찐빵을 먹으며 INTJ는 그들의 목표와 계획을 재정비하고, 미래에 대한 전략을 세웁니다. 이들은 찐빵의 부드러움 속에서 내면의 평화를 찾고, 그들의 지적 호기심을 충족시킵니다.",img:"/snack/snack3.jpeg"},{id:4,mbti:"ISTP",snack:"어묵",desc:"ISTP는 실용적이고 모험적인 성격으로, 겨울철에 어묵을 즐깁니다. 어묵은 따끈한 국물과 함께 제공되어, 추운 날씨에 즉각적인 따뜻함을 제공합니다. ISTP는 어묵을 통해 간편하게 에너지를 보충하고, 활동적인 하루를 보낼 수 있습니다. 어묵을 먹으며 ISTP는 그들의 모험심을 자극하고, 새로운 경험을 추구합니다. 이들은 어묵의 따뜻한 국물 속에서 삶의 활력을 느끼고, 그들의 실용적인 사고를 발전시킵니다.",img:"/snack/snack4.jpg"},{id:5,mbti:"ISFP",snack:"계란빵",desc:"ISFP는 감성적이고 예술적인 성격으로, 겨울철에 계란빵을 즐깁니다. 계란빵은 부드럽고 고소한 맛으로, ISFP의 섬세한 감각과 잘 어울립니다. 이들은 계란빵을 통해 따뜻한 감성을 느끼고, 창의적인 영감을 얻을 수 있습니다. 계란빵을 먹으며 ISFP는 그들의 예술적 표현을 탐구하고, 새로운 아이디어를 발전시킵니다. 이들은 계란빵의 부드러움 속에서 내면의 평화를 찾고, 그들의 감성적인 세계를 확장시킵니다.",img:"/snack/snack5.jpg"},{id:6,mbti:"INFP",snack:"찹쌀떡",desc:"INFP는 이상주의적이고 창의적인 성격으로, 겨울철에 찹쌀떡을 즐깁니다. 찹쌀떡은 쫀득한 식감과 달콤한 맛으로, INFP의 상상력을 자극합니다. 이들은 찹쌀떡을 통해 따뜻한 감정을 느끼고, 자신만의 세계에 빠져들 수 있습니다. 찹쌀떡을 먹으며 INFP는 그들의 이상과 꿈을 되새기고, 세상에 대한 깊은 이해를 추구합니다. 이들은 찹쌀떡의 쫀득함 속에서 영감을 얻고, 그들의 창의적인 아이디어를 발전시킵니다.",img:"/snack/snack6.jpg"},{id:7,mbti:"INTP",snack:"타코야키",desc:"INTP는 논리적이고 창의적인 성격으로, 겨울철에 타코야키를 즐깁니다. 타코야키는 바삭한 겉과 부드러운 속이 조화를 이루어, INTP의 독창적인 사고와 잘 맞습니다. 이들은 타코야키를 통해 새로운 맛을 탐험하고, 창의적인 아이디어를 떠올릴 수 있습니다. 타코야키를 먹으며 INTP는 그들의 논리적 사고를 발전시키고, 새로운 지식을 탐구합니다. 이들은 타코야키의 다양한 맛 속에서 영감을 얻고, 그들의 창의적인 아이디어를 발전시킵니다.",img:"/snack/snack7.png"},{id:8,mbti:"ESTP",snack:"핫도그",desc:"ESTP는 활동적이고 모험적인 성격으로, 겨울철에 핫도그를 즐깁니다. 핫도그는 간편하게 먹을 수 있는 간식으로, ESTP의 바쁜 일상에 잘 어울립니다. 이들은 핫도그를 통해 빠르게 에너지를 보충하고, 활기찬 하루를 보낼 수 있습니다. 핫도그를 먹으며 ESTP는 그들의 모험심을 자극하고, 새로운 경험을 추구합니다. 이들은 핫도그의 간편함 속에서 삶의 활력을 느끼고, 그들의 실용적인 사고를 발전시킵니다.",img:"/snack/snack8.jpg"},{id:9,mbti:"ESFP",snack:"팥빙수",desc:"ESFP는 사교적이고 즐거움을 추구하는 성격으로, 겨울철에도 팥빙수를 즐깁니다. 팥빙수는 다양한 토핑과 함께 제공되어, ESFP의 다채로운 성격과 잘 어울립니다. 이들은 팥빙수를 통해 친구들과 함께 즐거운 시간을 보내고, 새로운 경험을 나눌 수 있습니다. 팥빙수를 먹으며 ESFP는 그들의 사교성을 발휘하고, 주변 사람들과의 유대감을 강화합니다. 이들은 팥빙수의 다양한 맛 속에서 삶의 즐거움을 느끼고, 그들의 창의적인 아이디어를 발전시킵니다.",img:"/snack/snack9.jpg"},{id:10,mbti:"ENFP",snack:"호두과자",desc:"ENFP는 열정적이고 창의적인 성격으로, 겨울철에 호두과자를 즐깁니다. 호두과자는 고소한 맛과 바삭한 식감으로, ENFP의 활기찬 에너지와 잘 맞습니다. 이들은 호두과자를 통해 따뜻한 감정을 느끼고, 창의적인 아이디어를 떠올릴 수 있습니다. 호두과자를 먹으며 ENFP는 그들의 열정을 발휘하고, 새로운 아이디어를 탐구합니다. 이들은 호두과자의 고소함 속에서 영감을 얻고, 그들의 창의적인 아이디어를 발전시킵니다.",img:"/snack/snack10.jpg"},{id:11,mbti:"ENTP",snack:"고구마 맛탕",desc:"ENTP는 독창적이고 논쟁을 즐기는 성격으로, 겨울철에 고구마 맛탕을 즐깁니다. 고구마 맛탕은 달콤하고 바삭한 식감이 조화를 이루어, ENTP의 호기심을 자극합니다. 이들은 고구마 맛탕을 통해 새로운 맛을 탐험하고, 창의적인 대화를 나눌 수 있습니다. 고구마 맛탕을 먹으며 ENTP는 그들의 논리적 사고를 발전시키고, 새로운 지식을 탐구합니다. 이들은 고구마 맛탕의 다양한 맛 속에서 영감을 얻고, 그들의 창의적인 아이디어를 발전시킵니다.",img:"/snack/snack11.jpg"},{id:12,mbti:"ESTJ",snack:"군밤",desc:"ESTJ는 실용적이고 조직적인 성격으로, 겨울철에 군밤을 즐깁니다. 군밤은 고소하고 달콤한 맛으로, ESTJ의 체계적인 사고와 잘 어울립니다. 이들은 군밤을 통해 따뜻한 휴식을 취하고, 겨울철의 차가운 날씨를 이겨낼 수 있습니다. 군밤을 먹으며 ESTJ는 그들의 목표와 계획을 재정비하고, 미래에 대한 전략을 세웁니다. 이들은 군밤의 고소함 속에서 내면의 평화를 찾고, 그들의 지적 호기심을 충족시킵니다.",img:"/snack/snack12.jpg"},{id:13,mbti:"ESFJ",snack:"꽈배기",desc:"ESFJ는 사교적이고 배려심이 많은 성격으로, 겨울철에 꽈배기를 즐깁니다. 꽈배기는 달콤하고 바삭한 맛으로, ESFJ의 따뜻한 성격과 잘 맞습니다. 이들은 꽈배기를 통해 친구들과 함께 즐거운 시간을 보내고, 따뜻한 추억을 만들 수 있습니다. 꽈배기를 먹으며 ESFJ는 그들의 사교성을 발휘하고, 주변 사람들과의 유대감을 강화합니다. 이들은 꽈배기의 달콤함 속에서 삶의 즐거움을 느끼고, 그들의 창의적인 아이디어를 발전시킵니다.",img:"/snack/snack13.png"},{id:14,mbti:"ENFJ",snack:"호박죽",desc:"ENFJ는 따뜻하고 카리스마 있는 성격으로, 겨울철에 호박죽을 즐깁니다. 호박죽은 부드럽고 달콤한 맛으로, ENFJ의 따뜻한 마음과 잘 어울립니다. 이들은 호박죽을 통해 가족이나 친구들과 함께 따뜻한 시간을 보내고, 그들의 배려심을 표현할 수 있습니다. 호박죽을 먹으며 ENFJ는 그들의 따뜻한 마음을 나누고, 주변 사람들에게 긍정적인 영향을 미칩니다. 이들은 호박죽의 부드러움 속에서 내면의 평화를 찾고, 그들의 감성적인 세계를 확장시킵니다.",img:"/snack/snack14.jpeg"},{id:15,mbti:"ENTJ",snack:"찹쌀도넛",desc:"ENTJ는 결단력 있고 리더십이 강한 성격으로, 겨울철에 찹쌀도넛을 즐깁니다. 찹쌀도넛은 쫀득한 식감과 달콤한 맛으로, ENTJ의 강한 의지와 잘 맞습니다. 이들은 찹쌀도넛을 통해 에너지를 보충하고, 목표를 향해 나아갈 수 있습니다. 찹쌀도넛을 먹으며 ENTJ는 그들의 결단력을 발휘하고, 새로운 도전을 추구합니다. 이들은 찹쌀도넛의 쫀득함 속에서 영감을 얻고, 그들의 창의적인 아이디어를 발전시킵니다.",img:"/snack/snack15.jpg"}],H1=We.section`
